def h2b(packet):
    pack=''
    for q in packet:
        n=int(q,16)
        for i in range(4):
            pack+=str((n&(1<<(4-i-1)))>>(4-i-1))
    return pack

versions=0
def decode(packet,pos=0):
    global versions
    ret=None
    if pos<=len(packet)-6:
        print(f'packet={packet} pos={pos}')
        # print(f'pos={pos}')
        v=int(packet[pos:pos+3],2)
        pos+=3
        t=int(packet[pos:pos+3],2)
        pos+=3
        print(f'version={v} type={t}: ',end='')
        versions+=v
        if t==4:#literal
            print(f'literal: (pos={pos}) ',end='')
            v=''
            while pos<=len(packet)-5:
                print(f'pos={pos}')
                n=int(packet[pos:pos+5],2)
                # print(f'n={n}')
                print(f'q={n&0xf:x}')
                v+=f'{n&0xf:x}'
                pos+=5
                if n&0x10==0:break
            print(f'v={v}')
            v=int(v,16)
            print(f'v={v}')
            ret=v
        else:#operator?
            if t==0:
                op='SUM'
            elif t==1:
                op='PROD'
            elif t==2:
                op='MIN'
            elif t==3:
                op='MAX'
            elif t==5:
                op='GT'
            elif t==6:
                op='LT'
            elif t==7:
                op='EQ'
            else:
                raise Exception(f'operator type {t} notimp')
            print(op)
            l=[]
            i=int(packet[pos:pos+1],2)
            pos+=1
            if i==0:
                l15=int(packet[pos:pos+15],2)
                # print(f'n={n}')
                print(f'operator {op} lenID={i} len15={l15} ',end='')
                # print(f'len15={l15}')
                pos+=15
                endpos=pos+l15
                while pos<len(packet)-7 and pos<endpos:
                    # print(f'decoding at pos={pos}')
                    pos,r=decode(packet,pos)
                    if r==None:break
                    # print(f'decoding returned pos={pos}')
                    l+=[r]
                rem=len(packet)-pos
                if rem<8:
                    #pos=
                    # raise Exception(f'detected end of stream, rem={rem}')
                    print(f'detected end of stream, rem={rem}')
            else:
                n11=int(packet[pos:pos+11],2)
                # print(f'n={n}')
                print(f'operator {op} lenID={i} num11={n11}')
                pos+=11
                for i in range(n11):
                    # print(f'decoding at pos={pos}')
                    pos,r=decode(packet,pos)
                    if r==None:break
                    # print(f'decoding returned pos={pos}')
                    l+=[r]
            ret={op:l}
    else:pass
        # raise Exception(f'pos={pos} len={len(packet)}')
    return pos,ret

