import math
def compute(o):
    if type(o)==int:return o
    elif type(o)==dict:
        for op in o:
            if op=='SUM':
                l=[]
                for e in o[op]:
                    l+=[compute(e)]
                return sum(l)
            elif op=='PROD':
                l=[]
                for e in o[op]:
                    l+=[compute(e)]
                return math.prod(l)
            elif op=='MIN':
                l=[]
                for e in o[op]:
                    l+=[compute(e)]
                return min(l)
            elif op=='MAX':
                l=[]
                for e in o[op]:
                    l+=[compute(e)]
                return max(l)
            elif op=='LT':
                return int(compute(o[op][0])<compute(o[op][1]))
            elif op=='GT':
                print(f'GT o[op]={o[op]}')
                return int(compute(o[op][0])>compute(o[op][1]))
            elif op=='EQ':
                return int(compute(o[op][0])==compute(o[op][1]))
            else:
                raise Exception(f'op {op} notimp')
    else:
        raise Exception(f'type {type(o)} notimp')

